//Regular imports
import React from "react";
import Grid from "@material-ui/core/Grid";
//Actions

//Components
import First_Section_List from "./Sections/First/First_Section_List";
import Second_Section_List from "./Sections/Second/Second_Section_List";
import Third_Section_List from "./Sections/Third/Third_Section_List";
//Styles
import makeStyles from "./List_styles";

const List = ({ item }) => {
	const styles = makeStyles();
	const padding = 30;
	return (
		<div style={{ paddingLeft: { padding }, paddingRight: { padding } }}>
			<Grid className={styles.container} container spacing={0}>
				<Grid item xs={2} className={styles.item_Image_Container}>
					<First_Section_List />
				</Grid>
				<Grid item xs={8} className={styles.item_details_Container}>
					<Second_Section_List item={item} />
				</Grid>
				<Grid item xs className={styles.third_section_list_Container}>
					<Third_Section_List />
				</Grid>
			</Grid>
		</div>
	);
};

export default List;
